import React from 'react'
import Axios from 'axios'
const handleclick= () => {
    Axios.get("http://localhost:3001/end").then((response)=>{
        console.log(response)
    })
}
function Display() {
    return (
        <div>
            <button onClick={handleclick} >
                click me
            </button>
        </div>
    )
}

export default Display
